import React from "react";
import { Container } from "@mui/material";
import Grid from "@mui/material/Grid";
import Navbar from "../navbar/Navbar";

const Landingpage = () => {
  return (
    <div>
      <Navbar></Navbar>
      <Container maxWidth="sm">
        <Grid container spacing={2}>
          <h1></h1>
        </Grid>
      </Container>
    </div>
  );
};

export default Landingpage;
